import React, { Component } from "react";
import "./rainanim.css";

class RainAnim extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      /*<div className="sizer3">
        <div class="rain">
          <div class="drop"></div>
          <div class="waves">
            <div></div>
            <div></div>
          </div>
          <div class="splash"></div>
          <div class="particles">
            <div></div>
            <div></div>
            <div></div>
            <div></div>
          </div>
        </div>
      </div> */
      <div className='weather rain'></div>
    );
  }
}

export default RainAnim;
